import {TopBar} from "./App";
import { useState } from 'react';
import Alert from 'react-bootstrap/Alert';
import Button from 'react-bootstrap/Button';
import {Form} from "react-bootstrap";
import Card from 'react-bootstrap/Card';


const Questionnaire = () => {
    const [show, setShow] = useState(true);
  return (
      <>
          <TopBar/>
          <Alert show={show} variant="danger">
              <Alert.Heading>My Alert</Alert.Heading>
              <p>
                  We are not able to collect your private information, these questions just help us to better analyse the results
              </p>
              <hr />
              <div className="d-flex justify-content-end">
                  <Button onClick={() => setShow(false)} variant="outline-danger">Close me</Button>
              </div>
          </Alert>
          <Card>
              <Card.Header>Questionnaire</Card.Header>
              <Card.Body>
                  <blockquote className="blockquote mb-0">
                      <p>
                          {' '}
                          Please complete the following Questionnaire
                      </p>
                      <footer className="blockquote-footer">
                          <p> 1. What is your biological gender?</p>
                          <Form>
                              {['checkbox'].map((type) => (
                                  <div key={`default-${type}`} className="mb-3">
                                      <Form.Check
                                          type={type}
                                          id={"female"}
                                          label={"Female"}
                                      />
                                      <Form.Check
                                          type={type}
                                          label={`Male`}
                                          id={"male"}
                                      />
                                       <Form.Check
                                          type={type}
                                          label={`Perfer not to say`}
                                          id={"pns"}
                                      />
                                  </div>
                              ))}
                          </Form>
                           <p> 2. What is your age?</p>
                          <Form>
                              {['checkbox'].map((type) => (
                                  <div key={`default-${type}`} className="mb-3">
                                      <Form.Check
                                          type={type}
                                          id={"u35"}
                                          label={"Under 35"}
                                      />
                                      <Form.Check
                                          type={type}
                                          label={`35to60`}
                                          id={"35 - 60"}
                                      />
                                       <Form.Check
                                          type={type}
                                          label={``}
                                          id={"pns"}
                                      />
                                  </div>
                              ))}
                          </Form>
                      </footer>
                  </blockquote>
              </Card.Body>
          </Card>
      </>
  );}
export default Questionnaire;
